INSERT INTO `videocomments` VALUES (7684, 532543392, '西楼秋', 'https://i2.hdslb.com/bfs/face/20e189377a86b8befc448fb7f1d5615b0e6f06d0.jpg', '不须沈水自然香,\n瞒不过主腰胸带。\n你从前入道未是，\n说英雄谁是英雄。\n白日放歌须纵酒，\n嫖姚何日破重围。\n好是春风湖上亭 ，\n爽气朝来万里清。\n三万里河东入海，\n连山断处大江流。\n别巷寂寥人散后，\n想见城南春水深。\n\n如何独得百丈索,\n有人夺得玄珠饵。\n看是处春回柳眼，\n到如今犹宿花阴。\n送春争得不殷勤,\n我醉只知今夜月。\n上言二年隔烟水，\n去年却下七里滩。', '男', 373217420, 0, '1692718265', 4);
