INSERT INTO `videocomments` VALUES (9292, 234168395, '看-有鸽子', 'https://i0.hdslb.com/bfs/face/2028f28103a6122aa5f3ac5eb8c751884793fb86.jpg', '局势愈发动荡了，隐隐有几声枪响穿透层层雨幕传来，你所居住的这栋房子已经停电，不过好在暂时还足够安全。下午递送情报的时候你淋了雨，即便洗过热水澡，你的精神还是有些萎靡，所以母亲早早的便将你赶到了床上，还塞给你一杯热可可。你到底是睡不着的，虚掩的房门外，父亲和哥哥还有其他一些同僚正在紧张的讨论着眼下的局势，你几欲起身加入他们，但最终还是没有行动。明天充满未知，你需要有足够的精力去面对随时可能到来的变故，而今晚你要做的，就是在他们的守护之中好好的睡上一觉。', '女', 6402720, 3, '1697381863', 6);
